import React, { useEffect, useState } from "react";
import api from "../api";

const Skills = () => {
  const [skills, setSkills] = useState([]);

  useEffect(() => {
    api.get("/skills/").then((res) => setSkills(res.data));
  }, []);

  return (
    <section>
      <h2>Skills</h2>
      <div style={{ display: "flex", flexWrap: "wrap", gap: "12px" }}>
        {skills.map((skill) => (
          <span key={skill.id} className="highlight" style={{ padding: "8px 16px", borderRadius: "20px" }}>
            {skill.name}
          </span>
        ))}
      </div>
    </section>
  );
};

export default Skills;
